  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.h1}>Pok√©dex</Text>
      </View>
      <View style={styles.body}>
        <Text>Hello World!</Text>
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
